import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import Aladin from "./components/Aladin";

ReactDOM.render(
  <React.StrictMode>
    <Aladin />
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
